import React from 'react';

function App() {
	return (
	<div>
		Flower shop
		<p class="contacts">Contacts</p>
		<p class="profile">My profile</p>
		<ul>
			<li>1</li>
			<li>2</li>
			<li>3</li>
			<li>4</li>
			<li>5</li>
			<li>6</li>
			<li>7</li>
			<li>8</li>
			<li>9</li>
			<li>10</li>
			</ul>
	</div>
	);
}


export default App;
